import Jumbotron from "./components/jumbotron"
import jumboData from "./fixtures/jumbo.json"

export default function App() {
  console.log(jumboData)

  return (
    <Jumbotron.Container>
      {jumboData.map((item, index) => {
        <Jumbotron key={index} direction={item.direction}>
          Hello World
        </Jumbotron>
      })}
    </Jumbotron.Container>
  )
}
